import React from 'react';
import s from "./Immovables.module.css";
import Category from "../Category/Category";
import Subcategories from "../Subcategories/Subcategories";
import Adverts from "../../Adverts/Adverts";

const Immovables = (props) => {
  return (
      <div>
        <h3>Выберите категорию</h3>
        <div className={s.content}>
          <div className={s.categories}>
            <Subcategories nameSubCat={'Квартиры'} imgPath={'./room.svg'} urlSubcategory={'kvartiri'}/>
            <Subcategories nameSubCat={'Дома'} imgPath={'./architect.svg'} urlSubcategory={'doma'}/>
            <Category nameCategory={'Транспорт'} imgPath={'./auto.svg'} urlCategory={'transport'}/>
            <Category nameCategory={'Все для дома'} imgPath={'./household.svg'} urlCategory={'all_for_home'}/>
          </div>
        </div>
      </div>
  );
};

export default Immovables;
